E_D("replace into `yyd_articles` values('186','1','12,15,10,34','11393602761','什么是担保标？','','1',NULL,NULL,NULL,'1','','2013-11-05 18:24:37',NULL,NULL,'<div><h3>什么是担保标</h3></div><div><table><tbody><tr><td><p>&nbsp; &nbsp; 担保借款标是众和贷根据借款人扫描上传的资料进行审核，担保人以其众和贷账户的净资产做担保，根据借款人的信用状况，担保人和借款人之间协商并签订抵押担保手续，确保风险控制在合理的范围内。</p><p>&nbsp; &nbsp; 如借款人到期还款出现逾期，由担保人垫付本息还款，债权转让为担保人所有。鉴于其他网络借贷平台的担保标经验，众和贷讲严格审核借款者发布担保标，不仅在额度控制上，在担保人资格审核上都严格要求。</p><p><span style=\"font-family:Calibri;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>担保借款标逾期后，担保人未垫付本息前借款人还款，本息按正常标准还款，另外逾期每天按千分之八收取罚息，罚息全部由担保人收取。担保借款标逾期后，担保人垫付本息后借款人还款，本息按正常标准还款，另外逾期每天按千分之八收取罚息，本金利息及罚息全部为担保人收取。担保借款标逾期后<span style=\"font-family:Calibri;\">30</span>天以内担保人确定垫付时间，逾期第<span style=\"font-family:Calibri;\">30~33</span>天由网站程序执行担保人垫付。</p></td></tr></tbody></table></div>','','','10','20','0','0','','1383647126','127.0.0.1','1393602761','115.197.209.39');");
E_D("replace into `yyd_articles` values('156','1624','34','16241390722211','天标系统说明','','1',NULL,NULL,NULL,'1','','2013-10-13 17:27:27',NULL,NULL,'<p><span style=\"font-size:18px;\"><strong>主流贷天标系统说明 </strong></span></p><p><span style=\"font-size:18px;\">一、天标介绍： </span></p><p><span style=\"font-size:18px;\">天标不是单独的标种，天标是将网站的信用标、担保标、给力标、净值标按照天数选择后进行发标。 </span></p><p><span style=\"font-size:18px;\">二、天标的费用： </span></p><p><span style=\"font-size:18px;\">信用、担保、给力标管理费用：&nbsp; 0.6%本金÷30天×发标的天数 </span></p><p><span style=\"font-size:18px;\">净值标的管理费用：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 0.1%本金÷30天×发标的天数 </span></p><p><span style=\"font-size:18px;\">三、天标的利率设置： </span></p><p><span style=\"font-size:18px;\">天标的利率设置跟月标是一样的，都是以年利率设置为准。（比如发布3天的年利率为12%天标， </span></p><p><span style=\"font-size:18px;\">还款可以获得的利息12%÷12÷30×3×本金） </span></p><p><span style=\"font-size:18px;\">四、天标的结算时间： </span></p><p><span style=\"font-size:18px;\">天标的还款时间是满标审核后次日起算为第一天，到期当天还款。 </span></p><p><span style=\"font-size:18px;\">五、天标的自动投标设置：</span> </p>','','','10','86','0','0','','1381656519','115.208.140.139','1390722211','127.0.0.1');");
