用商渠金融的服务从事下列危害计算机信息网络安全的活动：<br />（1）未经授权进入踏入计算机信息网络或者使用计算机信息网络资源；&nbsp;　　　<br />（2）未经授权对他人计算机信息网络功能进行删除、修改或者增加；<br />（3）任何有意或无意制作、传播计算机病毒等破坏性程序；&nbsp;<br />（4）其他危害计算机及网络安全的行为。<br />2.3&nbsp;商渠金融不向任何用户提供如下保证：包括但不限于不保证服务一定能满足用户的要求，包括服务的连续性、及时性、安全性、准确性，也都不作保证。对于因不可抗力或任何非商渠金融原因造成的网络服务中断或其他缺陷，商渠金融不承担任何责任。&nbsp;<br />2.4&nbsp;商渠金融用户明确同意，其使用商渠金融服务所存在的风险及产生的一切后果由其自己承担。&nbsp;如发生下列任何一种情形，商渠金融有权单方面中断或终止向用户提供服务而无需通知用户，无需对用户或第三方承担任何责任：<br />2.5&nbsp;商渠金融有权随时修改服务条款的权利，用户在使用商渠金融时，有必要对最新的商渠金融服务条款进行仔细阅读和重新确认，当发生有关争议时，请以最新服务条款为准。<br /><br />三、其他约定<br /><br />3.1&nbsp;用户使用本服务的行为若有任何违反国家法律法规或侵犯任何第三方的合法权益的情形时，商渠金融有权直接删除该等违反规定之信息，并可以暂停或终止向该用户提供服务。<br />3.2&nbsp;本服务条款之效力、解释、执行均适用中华人民共和国法律。<br />3.3&nbsp;如发生争议，如双方就本协议内容或其执行发生任何争议，双方应尽量友好协商解决；协商不成时，任何一方均可向商渠金融所在地的人民法院提起诉讼。<br />3.4&nbsp;本服务条款最终的解释权归商渠金融所有。</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>欢迎光临商渠金融，我们将依据本隐私声明对访问者隐私予以保护。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>&nbsp;未成年人注意事项&nbsp;&nbsp;&nbsp;如果您未满18周岁，您无权使用本网站服务，因此我们希望您不要向我们提供任何个人信息。如果您未满18周岁，您只能在父母或监护人的陪同下才可以使用本网站服务。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>用户名和密码&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;当您打算注册成会员后，我们要求您选择一个用户名和密码，还要提供密码提示问题及其答案以便在您丢失密码后我们可以确认您的身份。您只能通过您的密码来使用您的帐号。如果您泄漏了密码，您可能丢失了您的个人识别信息，并且可能出现对您不利的后果。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>注册信息&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;您在注册为会员时，我们会要求您填写一张注册表。注册表要求提供您的真实姓名，地址，国籍，电话号码和电子邮件地址。另外，您还被要求提供您的公司的地址，电话号码和贵公司的服务和产品的简短说明。您还有权选择来填写附加信息。这些信息可能包括您公司所在的省份和城市，时区和邮政编码，传真号码，主页和您的职务。我们通过注册信息来获得会员的统计资料。我们将会用这些统计数据来给我们的会员分类，例如年龄、产业和国家等，以便有针对性地向我们的会员提供新的服务和机会。我们会通过您的邮件地址来通知您这些新的服务和机会。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>信用卡&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;我们的一些服务需要付费，我们会合理获取您的信用卡信息。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;您的交易行为&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;因您交易行为而产生的其它数据，我们将会用这些统计数据来给会员分类，以便有针对性地向我们的会员提供新的服务和机会。我们会通过您的邮件地址来通知您这些新的服务和机会。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>信息自动收集&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;商渠金融有可能自动接收并记录您的浏览器和计算机上的信息，其中包括您的&nbsp;IP&nbsp;地址，软硬件特征信息、以及您需求的网页记录。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>信息的披露和使用&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;我们不会向任何无关第三方提供，出售，出租，分享和交易用户的个人信息。我们不会向任何机构或个人披露可能用以识别用户的个人身份的资料，但从用户的用户名或其它可披露资料分析得出的资料不受此限制。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;外部链接&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;本站含有到其他网站的链接，商渠金融对相关网站的隐私保护措施不负任何责任，我们可能在任何需要的时候增加商业伙伴或共用品牌的网站。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;公开的交易信息&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;您提供发布的供贸易的物品信息或报价将被显示在公共区域，对任何用户来说是公开的。请注意所有在这些场所公开的信息会成为公共信息，请您在决定公布您的个人信息前仔细考虑。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>安全&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;本网站有相应的安全措施来确保我们掌握的信息不丢失，不被滥用和变造。这些安全措施包括向其它服务器备份数据和对用户密码加密。尽管我们有这些安全措施，但请注意在因特网上不存在“完善的安全措施”。</p><br /><p></p>','','','10','138','0','0','','1376101802','58.221.237.50','1399713187','124.207.38.24');");
E_D("replace into `yyd_articles` values('63','1','38','11399713140','隐私条款','','1',NULL,NULL,NULL,'1','','2013-08-10 10:20:12',NULL,NULL,'<span style=\"font-size:16px;\"><strong>网站隐私声明</strong><br />&nbsp;一、通用条款<br />（一）特别承诺条款<br />本公司同意按照商渠金融服务协议（以下简称协议）的规定及其操作规则提供基于互联网的相关服务（以下称“网络服务”）。为获得网络服务，服务使用者（以下称“用户”）应当同意本协议的全部条款并按照页面上的提示完成全部的注册程序。用户在进行注册程序过程中选择“我已阅读并且同意帮你贷网贷服务协议。”选项，即表示用户完全接受本协议项下的全部条款。若不接受该网站服务，或不同意的请立即离开本网站。<br />&nbsp; （二）服务内容<br />1、网络服务的具体内容由本公司根据实际情况提供借投资信息。本公司保留随时变更、中断或终止部分或全部网络服务的权利。<br />2、用户理解，本公司仅提供相关的网络服务，除此之外与相关网络服务有关的接受设备及所需的费用均应由用户自行负担。<br />&nbsp;（三）使用规则<br />1、用户在申请使用本公司网络服务时，必须向本公司提供真实、准确的个人资料，如个人资料有任何变动，必须及时更新。<br />2、用户注册成功后，本公司将给予每个用户一个用户名及相应的密码，该用户名和密码由用户负责保管；您的用户名和密码是登录本网站和在本网站进行活动的唯一凭证，不得将本网站的用户名转让给第三方或者授权给第三方使用。若因私自授权他人使用造成的后果，将由你承担相应的法律责任。<br />3、用户必须同意并承诺接受本公司通过电子邮件或其他方式向用户发送服务信息、催收及其他相关服务信息。<br />若因此电子邮件及其它方式问题而造成送达不了的法律后果由该用户承担。<br />4、用户在使用本公司网络服务过程中，必须遵循以下原则：<br />①你在本公司的网页上发布信息或者利用本公司的服务时必须符合中国现行的有关法律法规。<br />②在本公司的网页上发布信息或者利用本公司的服务时还必须符合其他有关国家和地区的法律规定以及国际法的有关规定。<br />③不得利用本公司的服务擅自进入计算机信息网络，使用、修改、删除、增加计算机网络信息资源；故意制作、传播计算机病毒等破坏性程序的及其他危害计算机信息网络安全的行为。<br />④不以任何方式干扰本公司的服务。<br />⑤遵守本公司的所有其他规定和程序。<br />二、特别的隐私保护<br />（一）、用户身份限制<br />《中华人民共和国民法通则》规定的未满十八周岁的人、限制民事行为能力人、中国大陆以外地区人士及自然人以外的非法组织无资格注册成为本网站用户并使用本网站的服务。<br />（二）、涉及的个人资料<br />本网站收集个人资料的主要目的在于向用户提供一个顺利、有效和适当的交易机会。本网站收集本网站认为达成该目的所必须的您的个人资料。<br />本网站可自公开及私人资料来源收集您的额外资料，以更好地了解本网站用户，并为适合本网站服务、解决争议并有助确保在网站进行交易的安全性。<br />本网站按照您在本网站网址上的行为自动追踪关于您的某些资料。本网站利用这些资料以便有利网上投资交易进行有关本网站之用户的服务。<br />本网站在本网站的某些网页上使用诸如“Cookies”的资料收集装置。<br />您将个人通讯信息（诸如手机短信、电邮或信件）交付给本网站，或如果其他用户或第三方向本网站发出关于您在本网站上的活动或登录事项的通讯信息，本网站可以将这些资料收集在您的专门档案中。<br />（三）、本网站对您的资料的使用<br />1、您同意本网站可使用关于您的个人资料（包括但不限于本网站持有的有关您的档案中的资料，及本网站从您目前及以前在本网站上的活动所获取的其他资料）以解决争议、对纠纷进行调停、有助于确保在本网站进行安全交易，并执行本网站的用户协议。本网站有时候可能调查多个用户以识别问题或解决争议，特别是本网站可审查您的资料以区分使用多个用户名或别名的用户。为限制在网站上的欺诈、非法或其他刑事犯罪活动，使本网站免受其害，您同意本网站可通过人工或自动程序对您的个人资料进行评价。<br />2、您同意本网站可以使用您的个人资料以改进本网站的推广和促销工作、分析网站的使用率、改善本网站的内容和产品推广形式，并使本网站的网站内容、设计和服务更能符合用户的要求。这些使用能改善本网站的网页，以调整本网站的网页使其更能符合您的需求，从而使您在使用本网站服务时得到更为顺利、有效、安全及适当的交易体验。<br />3、您同意本网站利用您的资料与您联络并（在某些情况下）向您传递针对您的兴趣而提供的信息，例如：有针对性的广告条、行政管理方面的通知、产品提供以及有关您使用本网站的通讯。您接受服务协议和隐私规则即为明示同意收取这些资料。<br />4、您同意本网站可使用关于您的个人资料向您追索债权，本网站有权在本网站及互联网络上公布您的违法、违约行为，并将该内容记入任何与您相关的信用资料和档案。<br />（四）、本网站对您的资料的披露<br />本网站将采用行业标准惯例和双方约定予以保护您的个人资料，但鉴于技术限制，本网站不能确保您的全部私人通讯及其他个人资料不会通过本隐私规则中未列明的途径泄露出去。<br />本网站有义务根据有关法律要求向司法机关和政府部门提供您的个人资料。在您未能按照与本网站签订的服务协议、居间协议、行纪协议或者与本网站其他用户签订的借款协议的约定履行自己应尽的义务时，本网站有权根据自己的判断或者与该笔交易有关的其他用户的请求披露您的个人资料，并作出评论。<br />（五）、您对其他用户的资料的使用<br />在本网站提供的交易活动中，您无权要求本网站提供其他用户的个人资料，除非符合以下条件：<br />（a）您已经申请人民法院调取相关；<br />（b）与您有关的其他用户（包括交易关系、本网站登记的朋友关系）逾期未归还借款本息；<br />（c）本网站被吊销营业执照、解散、清算、宣告破产或者其他有碍于您收回借款本息的情形。<br />如您在与本网站的其他用户的交易中逾期未归还借款本息，本网站的其他用户可以采取发布您个人信息的方式向您追索债权，但本网站对该等用户的行为免责。<br />（六） 电子邮件<br />不得使用本网站提供的服务或其他电子邮件转发服务发出垃圾邮件或其他可能违反本网站的用户协议或隐私规则的内容。<br />本网站不会出租或出售这些电子邮件地址。本网站除了利用该电子邮件地址发出您的电子邮件之外将不作任何其他用途。<br />（七）密码的安全性<br />您须对使用您的用户名和密码所采取的一切行为负责。因此，本网站建议您不要向任何第三方披露您在本网站的用户名和密码。<br />（八） 规则修改<br />本网站可能不时按照您的意见和本网站的需要修改本隐私规则，以准确地反映本网站的资料收集及披露惯例。</span>','','','10','882','0','0','','1376101802','192.168.2.218','1399713140','124.207.38.24');");
E_D("replace into `yyd_articles` values('67','1','38','11399713171','注册协议','','1',NULL,NULL,NULL,'1','','2013-08-10 10:20:12',NULL,NULL,'<p></p><span style=\"font-size:16px;\"></span><p>您正在访问商渠金融（p2b.salqu.com)，若要继续访问和使用商渠金融，您必须不加修改地完全接受本网站的服务声明中所包含的各项条款、政策以及指南，并同意商渠金融即时刊登的通告，并且遵守中国政府有关互联网的相关法律政策，以及遵守本网站制定的各项规定与规则。<br /><br />您一旦使用商渠金融的服务，即视为您已了解并完全同意本服务条款各项内容，包括商渠金融对服务条款随时做的任何修改。除非另有规定，否则任何变更或修改将在修订内容于商渠金融发布之时立即生效，您对商渠金融的使用将表明您接受此变更或修改。如您不同意本服务协议及/或随时对其的修改、及/或法律声明，您可以停止访问商渠金融并放弃选择商渠金融提供的服务。<br /><br /><br />一．服务内容与隐私政策<br /><br />1.1&nbsp;商渠金融上的内容，包括信贷产品的内容（包括但不限于金融单位名称、联系人、联系信息、产品的描述和说明、相关图片、相关贷款收费说明等）的信息均由用户在线提交或者用户授权商渠金融工作人员提交发布，相关用户依法应对其提供的任何信息承担全部责任，商渠金融对此等信息的准确性、完整性、合法性或真实性均不承担任何责任。此外，商渠金融对任何使用或提供本网站信息的商业活动及其风险不承担任何责任。<br />1.2&nbsp;商渠金融会根据实际情况随时调整商渠金融平台提供的服务种类、形式。商渠金融不承担因业务调整给用户造成的损失。商渠金融保留变更、中断或终止部分网络服务的权利。<br />1.3&nbsp;用户在申请商渠金融服务时，必须提供真实资料，如因注册信息不真实而引起的后果由会员自行承担，商渠金融不承担任何责任。倘若商渠金融发现用户注册信息虚假、不准确或不完整的，则有权自行决定是否终止该用户帐号。<br />1.4&nbsp;商渠金融用户注册成功后，将被分配一个用户名及密码，该信息由用户自行负责保管，用户发布任何信息均属于个人意见，并不代表商渠金融、商渠金融运营商或商渠金融关联公司的意见，用户应对以其用户帐号进行的所有活动和事件负法律责任。<br />1.5&nbsp;&nbsp;因黑客行为、计算机病毒侵入等自身原因致使商渠金融帐号、密码被他人非法盗用、篡改导致损失的，商渠金融不承担赔付责任。如您发现任何非法使用用户帐号或安全漏洞的情况，请立即与商渠金融联系，一旦核实采纳，商渠金融将给予一定的奖励。<br />1.6&nbsp;商渠金融用户的访问IP和交易行为，有可能被商渠金融的服务器予以跟踪用户，但这些措施仅仅只是出于安全的必要。如果商渠金融没有发现任何安全问题，会及时删除收集到的IP地址。<br />1.7&nbsp;商渠金融不会向任何第三方商业机构提供，出售，出租，分享和交易未被用户授权的个人信息，除非用户直接或间接同意与商渠金融合作的机构产生联系和合作。<br />1.8&nbsp;除非政府或相关法律要求提供您的信息时，商渠金融才会披露您的资料。包括但不限于下列情形：<br />（1）事先获得用户的明确授权；<br />（2）按照政府主管部门或相关法律的要求；<br />（3）只有透露你的个人资料，才能提供你所要求的产品和服务；&nbsp;<br />（4）以维护商渠金融合法权益之目的；<br />（5）维护社会公众利益；<br />（6）符合其他合法要求；<br /><br /><br />二、用户守则与免责声明<br /><br /><br />2.1&nbsp;用户在使用商渠金融服务过程中，必须遵循国家的相关法律法规，任何下列行为的发布、上传、散播或以其它方式均不被允许：<br />（1）危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的，煽动民族仇恨、民族歧视，破坏民族团结的；　　　&nbsp;<br />（2）损害国家荣誉和利益的，散布谣言，扰乱社会秩序，破坏社会稳定的；<br />（3）破坏国家宗教政策，宣扬邪教和封建迷信的；　　　&nbsp;　　　&nbsp;<br />（4）散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的、欺诈性的；<br />（5）侮辱或者诽谤他人，侵害他人合法权益的；　　　&nbsp;<br />（6）其他违反宪法和法律、行政法规或规章制度的；<br />2.2&nbsp;用户不得利用商渠金融的服务从事下列危害计算机信息网络安全的活动：<br />（1）未经授权进入踏入计算机信息网络或者使用计算机信息网络资源；&nbsp;　　　<br />（2）未经授权对他人计算机信息网络功能进行删除、修改或者增加；<br />（3）任何有意或无意制作、传播计算机病毒等破坏性程序；&nbsp;<br />（4）其他危害计算机及网络安全的行为。<br />2.3&nbsp;商渠金融不向任何用户提供如下保证：包括但不限于不保证服务一定能满足用户的要求，包括服务的连续性、及时性、安全性、准确性，也都不作保证。对于因不可抗力或任何非商渠金融原因造成的网络服务中断或其他缺陷，商渠金融不承担任何责任。&nbsp;<br />2.4&nbsp;商渠金融用户明确同意，其使用商渠金融服务所存在的风险及产生的一切后果由其自己承担。&nbsp;如发生下列任何一种情形，商渠金融有权单方面中断或终止向用户提供服务而无需通知用户，无需对用户或第三方承担任何责任：<br />2.5&nbsp;商渠金融有权随时修改服务条款的权利，用户在使用商渠金融时，有必要对最新的商渠金融服务条款进行仔细阅读和重新确认，当发生有关争议时，请以最新服务条款为准。<br /><br />三、其他约定<br /><br />3.1&nbsp;用户使用本服务的行为若有任何违反国家法律法规或侵犯任何第三方的合法权益的情形时，商渠金融有权直接删除该等违反规定之信息，并可以暂停或终止向该用户提供服务。<br />3.2&nbsp;本服务条款之效力、解释、执行均适用中华人民共和国法律。<br />3.3&nbsp;如发生争议，如双方就本协议内容或其执行发生任何争议，双方应尽量友好协商解决；协商不成时，任何一方均可向商渠金融所在地的人民法院提起诉讼。<br />3.4&nbsp;本服务条款最终的解释权归商渠金融所有。</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>欢迎光临商渠金融，我们将依据本隐私声明对访问者隐私予以保护。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>&nbsp;未成年人注意事项&nbsp;&nbsp;&nbsp;如果您未满18周岁，您无权使用本网站服务，因此我们希望您不要向我们提供任何个人信息。如果您未满18周岁，您只能在父母或监护人的陪同下才可以使用本网站服务。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>用户名和密码&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;当您打算注册成会员后，我们要求您选择一个用户名和密码，还要提供密码提示问题及其答案以便在您丢失密码后我们可以确认您的身份。您只能通过您的密码来使用您的帐号。如果您泄漏了密码，您可能丢失了您的个人识别信息，并且可能出现对您不利的后果。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>注册信息&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;您在注册为会员时，我们会要求您填写一张注册表。注册表要求提供您的真实姓名，地址，国籍，电话号码和电子邮件地址。另外，您还被要求提供您的公司的地址，电话号码和贵公司的服务和产品的简短说明。您还有权选择来填写附加信息。这些信息可能包括您公司所在的省份和城市，时区和邮政编码，传真号码，主页和您的职务。我们通过注册信息来获得会员的统计资料。我们将会用这些统计数据来给我们的会员分类，例如年龄、产业和国家等，以便有针对性地向我们的会员提供新的服务和机会。我们会通过您的邮件地址来通知您这些新的服务和机会。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>信用卡&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;我们的一些服务需要付费，我们会合理获取您的信用卡信息。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;您的交易行为&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;因您交易行为而产生的其它数据，我们将会用这些统计数据来给会员分类，以便有针对性地向我们的会员提供新的服务和机会。我们会通过您的邮件地址来通知您这些新的服务和机会。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>信息自动收集&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;商渠金融有可能自动接收并记录您的浏览器和计算机上的信息，其中包括您的&nbsp;IP&nbsp;地址，软硬件特征信息、以及您需求的网页记录。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>信息的披露和使用&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;我们不会向任何无关第三方提供，出售，出租，分享和交易用户的个人信息。我们不会向任何机构或个人披露可能用以识别用户的个人身份的资料，但从用户的用户名或其它可披露资料分析得出的资料不受此限制。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;外部链接&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;本站含有到其他网站的链接，商渠金融对相关网站的隐私保护措施不负任何责任，我们可能在任何需要的时候增加商业伙伴或共用品牌的网站。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;公开的交易信息&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;您提供发布的供贸易的物品信息或报价将被显示在公共区域，对任何用户来说是公开的。请注意所有在这些场所公开的信息会成为公共信息，请您在决定公布您的个人信息前仔细考虑。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>安全&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;本网站有相应的安全措施来确保我们掌握的信息不丢失，不被滥用和变造。这些安全措施包括向其它服务器备份数据和对用户密码加密。尽管我们有这些安全措施，但请注意在因特网上不存在“完善的安全措施”。</p><br /><p></p>','','','10','170','0','0','','1376101802','58.221.237.50','1399713171','124.207.38.24');");
E_D("replace into `yyd_articles` values('190','1','6','11408329803','商渠金融正式上线','','1',NULL,NULL,NULL,'1','','2014-05-10 17:00:18',NULL,NULL,'<p style=\"margin: 0px 0px 1.5em; padding: 0px; color: rgb(85, 85, 85); line-height: 24px; \"><span style=\"margin: 0px; padding: 0px; \"><span style=\"font-family:Microsoft YaHei;font-size:18px;\">&nbsp; &nbsp; &nbsp;商渠金融是专属于中小企业的P2B网络投资、贷款服务平台.为投资理财用户和贷款用户两端提供公平、透明、安全、高效的互联网金融服务。商渠金融可以为借贷人寻找到最佳的贷款渠道，也能帮银行及金融机构寻找精准匹配的信贷客户！商渠金融本身不提供贷款，而是重点着眼于帮助个人、中小企业筛选金融市场上的正规合法贷款渠道，帮助其最终实现贷款，实现网站“找正规贷款，就上商渠金融”的定位初衷！</span></span></p><p style=\"margin: 0px 0px 1.5em; padding: 0px; color: rgb(85, 85, 85); line-height: 24px; \"><span style=\"font-family:Microsoft YaHei;font-size:18px;\"><span style=\"margin: 0px; padding: 0px; \"></span></span></p><p class=\"p0\" style=\"margin: 0pt 0px; padding: 0px; color: rgb(85, 85, 85); line-height: 24px; \"><span style=\"margin: 0px; padding: 0px; \"><span style=\"font-family:Microsoft YaHei;font-size:18px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); \">&nbsp; &nbsp; &nbsp;商渠金融</span><span style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); \">是一座将信贷资源与信贷需求连接在一起的“桥”。任何一家金融机构，包括银行、小贷公司、担保公司、典当行等任何国家指定的合法贷款机构，均可与</span><span style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); \">商渠金融</span><span style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); \">建立直接合作联系；任何一家金融机构的信贷经理或业务人员均可入驻</span><span style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); \">商渠金融</span><span style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); \">平台，获得客户机会。让需要贷款的人和提供贷款的业务人员直接沟通匹配，打造一个正规方便的信贷直销平台。</span></span></span></p><br />','','','10','0','0','0','','1399712706','124.207.38.24','1408329803','61.153.201.22');");
E_D("replace into `yyd_articles` values('181','1','12,15,10,34','11383646989','什么是流转借款？','','1',NULL,NULL,NULL,'1','','2013-11-05 01:09:57',NULL,NULL,'<p style=\"margin: 0px; padding: 0px; font-size: 13px; color: rgb(51, 51, 51); font-family: 宋体; line-height: 22px; \"><span style=\"margin: 0px; padding: 0px; font-size: 14px; \"><span style=\"margin: 0px; padding: 0px; font-size: 12px; color: rgb(73, 73, 73); \"><span style=\"margin: 0px; padding: 0px; font-size: 14px; \"><span style=\"margin: 0px; padding: 0px; font-size: 12px; \">流转借款标</span></span></span></span></p><p style=\"margin: 0px; padding: 0px; font-size: 13px; color: rgb(51, 51, 51); font-family: 宋体; line-height: 22px; \">1、流转标的含义是指：债权人将手中优质的债权转让给其他有投资意愿的投资人，并且承诺在一定期限内回购该债权的投资品种。</p><p style=\"margin: 0px; padding: 0px; font-size: 13px; color: rgb(51, 51, 51); font-family: 宋体; line-height: 22px; \">2、其优势：投资人即刻申购即刻生效，无资金空档期，使投资人的资金获得最佳收益。</p><p style=\"margin: 0px; padding: 0px; font-size: 13px; color: rgb(51, 51, 51); font-family: 宋体; line-height: 22px; \">3、流转标和抵押标的区别是：流转标投标计息即奖励，不会使资金站岗，到期还本息；抵押标标满计息，按月付息到期还本！</p>','','','10','13','0','0','','1383585019','127.0.0.1','1383646989','127.0.0.1');");
E_D("replace into `yyd_articles` values('182','1','12,15,10,34','11383646980','什么是信用借款标？','','1',NULL,NULL,NULL,'1','','2013-11-05 18:04:48',NULL,NULL,'<div class=\"content_h3\"><h3>什么是信用借款标？</h3></div><!--内容开始--><div class=\"content_ro2\"><table width=\"90%\"><tbody><tr><td><table style=\"word-wrap: break-word; border-collapse: collapse; table-layout: fixed; color: rgb(68, 68, 68); empty-cells: show; font-size: 12px; line-height: 15px; font-family: Tahoma, ''Microsoft Yahei'', Simsun; width: 680px; \" cellspacing=\"0\" cellpadding=\"0\"><tbody style=\"WORD-WRAP: break-word\"><tr style=\"WORD-WRAP: break-word\"><td id=\"postmessage_6900\" class=\"t_f\" style=\"WORD-WRAP: break-word; FONT-SIZE: 14px\"><p align=\"left\"><span style=\"FONT-SIZE: 18px\"><strong>信用借款标</strong></span> </p><p align=\"left\"><span style=\"FONT-SIZE: 16px\">信用借款标显示“信”字标记，是一种免抵押、免担保、纯信用，最高授信为10万的小额个人信用贷款标，主要面向公务员、医生或教师等机关企事业单位的在编人员。如借款人到期还款出现困难，逾期第30~33天由网站风险金补偿，债权转让为温州贷网站所有。</span> </p><p align=\"left\"><span style=\"FONT-SIZE: 16px\">信用借款标未补偿本金前借款人还款，本息按正常标准还款，另外逾期每天按千分之二收取罚息，投标人和<span style=\"color: rgb(68, 68, 68); font-family: 宋体;font-size:16px; line-height: 15px; \">平台</span>各收取千分之一.</span><br /><span style=\"FONT-SIZE: 16px\">信用借款标补偿本金后借款人还款，本息按正常标准还款，另外逾期每天按千分之二收取罚息，本金利息及罚息全部为<span style=\"color: rgb(68, 68, 68); font-family: 宋体;font-size:16px; line-height: 15px; \">平台</span>收取.</span><br /><span style=\"FONT-SIZE: 16px\">信用借款标逾期后第30~33天由网站先行补偿本金还款.</span></p></td></tr></tbody></table></td></tr></tbody></table></div>','','','10','12','0','0','','1383646322','127.0.0.1','1383646980','127.0.0.1');");
E_D("replace into `yyd_articles` values('183','1','12,15,10,34','11383646970','什么是净值借款标？','','1',NULL,NULL,NULL,'1','','2013-11-05 18:12:10',NULL,NULL,'<div class=\"content_h3\"><h3>什么是净值借款标？</h3></div><!--内容开始--><div class=\"content_ro2\"><table width=\"90%\"><tbody><tr><td><table style=\"word-wrap: break-word; border-collapse: collapse; table-layout: fixed; color: rgb(68, 68, 68); empty-cells: show; font-size: 12px; line-height: 15px; font-family: Tahoma, ''Microsoft Yahei'', Simsun; width: 680px; \" cellspacing=\"0\" cellpadding=\"0\"><tbody style=\"WORD-WRAP: break-word\"><tr style=\"WORD-WRAP: break-word\"><td id=\"postmessage_6900\" class=\"t_f\" style=\"WORD-WRAP: break-word; FONT-SIZE: 14px\"><p><strong><span style=\"FONT-SIZE: 18px\">净值借款标</span></strong> </p><p>&nbsp; <span style=\"FONT-SIZE: 16px\">净值借款标显示标记“净”，允许发布的最大金额 为净资产，净资产负数 0&nbsp;、500元以下金额不能发标。 可以循环借款。但用户提现将受到限制。他是黄牛标的初始形态，未来温州贷将择机推出净值借款标手续费，利息等方面进行更新改革。</span><span style=\"FONT-SIZE: 16px; COLOR: #000000\">如果客户净资产大于借款金额，<span style=\"color: rgb(68, 68, 68); font-family: 宋体;font-size:16px; line-height: 15px; \">平台</span>允许发布净值借款标用于临时周转。</span><span style=\"FONT-SIZE: 16px\">他是一种相对安全系数很高的借款标，因此利率方面可能比较低，适合资金黄牛，用户可以借助此标放大自己的投资杠杠。净值借款标未补偿本金前借款人还款，本息按正常标准还款，另外逾期每天按千分之二收取罚息，投标人和<span style=\"color: rgb(68, 68, 68); font-family: 宋体;font-size:16px; line-height: 15px; \">平台</span>各收取千分之一.</span><br /><span style=\"FONT-SIZE: 16px\">净值借款标补偿本金后借款人还款，本息按正常标准还款，另外逾期每天按千分之二收取罚息，本金利息及罚息全部为<span style=\"color: rgb(68, 68, 68); font-family: 宋体;font-size:16px; line-height: 15px; \">平台</span>收取.</span><br /><span style=\"FONT-SIZE: 16px\">净值借款标逾期后第30~33天由网站先行补偿本金还款。</span></p></td></tr></tbody></table></td></tr></tbody></table></div>','','','10','12','0','0','','1383646358','127.0.0.1','1383646970','127.0.0.1');");
E_D("replace into `yyd_articles` values('184','1','12,15,10,34','11383646961','什么是秒还借款标？','','1',NULL,NULL,NULL,'1','','2013-11-05 18:12:43',NULL,NULL,'<div class=\"content_h3\"><h3>什么是秒还借款标？</h3></div><!--内容开始--><div class=\"content_ro2\"><table width=\"90%\"><tbody><tr><td><table style=\"word-wrap: break-word; border-collapse: collapse; table-layout: fixed; color: rgb(68, 68, 68); empty-cells: show; font-size: 12px; line-height: 15px; font-family: Tahoma, ''Microsoft Yahei'', Simsun; width: 680px; \" cellspacing=\"0\" cellpadding=\"0\"><tbody style=\"WORD-WRAP: break-word\"><tr style=\"WORD-WRAP: break-word\"><td id=\"postmessage_6900\" class=\"t_f\" style=\"WORD-WRAP: break-word; FONT-SIZE: 14px\"><p align=\"left\"><span style=\"FONT-SIZE: 18px\"><strong>秒还借款标</strong></span> </p><p align=\"left\"><span style=\"FONT-SIZE: 16px\">&nbsp;&nbsp; 秒还标显示标记“秒”，借款者发布秒还标，利息和管理费将被冻结，投标满后，系统自动审核通过，发标人瞬间送出利息和管理费，投资者则收回本金和利息。秒还标是一种娱乐庆祝送钱的标，把快乐送给大家。</span></p></td></tr></tbody></table></td></tr></tbody></table></div>','','','10','20','0','0','','1383646397','127.0.0.1','1383646961','127.0.0.1');");
